INSERT INTO `brand` VALUES ('14cb7945-5a2c-442d-93e2-0a3557340557','K&K','K&K Fashion','K&K là một trong những thương hiệu được yêu thích nhất. Với mức giá bình dân nhưng chất lượng và thiết kế rất tốt, những sản phẩm của K&K vẫn tôn lên vẻ sang trọng và quý phái của người phụ nữ.','2023-04-14 15:48:31','2023-04-14 15:48:31',1,0),('1f224bdd-08f7-4c42-8c02-d4d2419a9f50','NEM','NEM fashion','Thương hiệu thời trang nữ ở Việt Nam không thể không kể tới NEM. Đây là thương hiệu thời trang nữ cao cấp được chị em công sở yêu thích vì thiết kế thanh lịch, quyến rũ và tinh tế','2023-04-14 15:46:15','2023-04-14 15:46:15',1,0),('3c1a6e56-0d2c-4028-99df-ea63d3ab0249','SeAM','Seven AM','Seven AM là hãng thời trang được đánh giá cao về chất liệu bền, đẹp và tính ứng dụng cao, phù hợp với nhiều đối tượng.','2023-04-14 15:47:57','2023-04-14 15:47:57',1,0),('5cb0edca-62e1-49c6-bf0d-9bb4c20b3dd3','IVM','IVy Moda','Với phương châm đem lại sự hiện đại, cá tính và thời thượng cho khách hàng, thương hiệu này luôn duy trì ra mắt những dòng sản phẩm với xu hướng mới nhất, sản phẩm đa dạng.','2023-04-14 15:48:59','2023-04-14 15:48:59',1,0),('763532dd-4b6d-44a1-84f6-df14320997c4','YD','YODY',NULL,'2023-04-13 23:13:10','2023-04-13 23:13:10',1,NULL),('7d46f40c-3677-4027-a14a-27f60644a6d1','EdE','Eva de Eva','Được xem là một trong những thương hiệu thời trang cao cấp đầu tiên của Việt Nam, Eva de Eva luôn giữ một vị trí quan trọng trong ngành thời trang nói riêng.','2023-04-14 15:49:21','2023-04-14 15:49:21',1,0),('c2a1d850-6fb9-41c0-971f-2e1d4f51258f','Bo','Boran','Boran là một thương hiệu thời trang nữ mang đậm phong cách Hàn Quốc tại Việt Nam, với sự độc đáo và tính ứng dụng cao, những sản phẩm ở đây sẽ giúp bạn có thể dễ dàng lựa chọn được những items phù hợp với nhiều hoàn cảnh khác nhau.','2023-04-14 15:50:25','2023-04-14 15:50:25',1,0),('ceb4fe16-df1e-4564-bd81-41b4e59691cf','Delight','Delight','Không lựa chọn phong cách công sở khuôn mẫu như trước đây, Delight đang dần phá vỡ những quy tắc thời trang công sở bằng những sản phẩm mang thiết kế độc đáo nhưng vẫn thanh lịch, kiểu dáng chuẩn mực.','2023-04-14 15:50:44','2023-04-14 15:50:44',1,0),('dc69f801-bd6f-4f7b-9f5c-0d46ac98be24','ChL','Chic-Land','Chic – Land không chỉ là thương hiệu nổi tiếng nhờ thiết kế công sở nữ cao cấp mà còn được biết đến nhờ chuỗi cửa hàng thời trang xa hoa bậc nhất.','2023-04-14 15:47:32','2023-04-14 15:47:32',1,0),('e3f89b83-91ea-41cb-a9e1-d0772ce54de0','Eli','Elise','Với quy mô cửa hàng rộng khắp và hiệu ứng lan tỏa từ những tín đồ thời trang, Elise xứng đáng nằm trong top những thương hiệu thời trang nữ đẳng cấp nhất.','2023-04-14 15:49:39','2023-04-14 15:49:39',1,0),('e78b8c2c-5f04-45ca-8366-fb6132474a93','Hno','Hnoss','Dù là một hãng thời trang rất trẻ nhưng Hnoss dần khẳng định được vị trí của mình từ những thiết kế trẻ trung, độc đáo mà quyến rũ, đặc biệt thu hút giới trẻ.','2023-04-14 15:50:00','2023-04-14 15:50:00',1,0);
