DROP TABLE IF EXISTS `order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `order` (
  `OrderId` char(36) NOT NULL,
  `TotalAmount` int NOT NULL,
  `TotalPrice` decimal(10,0) NOT NULL,
  `Note` text,
  `Status` tinyint NOT NULL DEFAULT '1' COMMENT '1 - Cho xac nhan\\n2 - Cho lay hang\\n3 - Dang van chuyen\\n4 - Da nhan hang\\n5 - Hoan thanh\\n6 - Huy',
  `CancelReason` text,
  `PaymentMethod` int DEFAULT '1',
  `CreatedAt` datetime DEFAULT NULL,
  `ModifiedAt` datetime DEFAULT NULL,
  `AddressReceiveId` char(36) NOT NULL,
  `ShipmentId` char(36) NOT NULL,
  `OrderCode` varchar(100) DEFAULT NULL,
  `IsPaid` tinyint DEFAULT '0',
  `AddressDetail` varchar(255) DEFAULT NULL,
  `Phone` varchar(45) DEFAULT NULL,
  `Receiver` varchar(50) DEFAULT NULL,
  `CustomerId` char(36) DEFAULT NULL,
  `PriceShip` decimal(10,0) DEFAULT NULL,
  `DateReceive` datetime DEFAULT NULL,
  PRIMARY KEY (`OrderId`),
  KEY `Fk_Order_AddressReceive_idx` (`AddressReceiveId`),
  KEY `Fk_Order_Shipment_idx` (`ShipmentId`),
  CONSTRAINT `Fk_Order_AddressReceive` FOREIGN KEY (`AddressReceiveId`) REFERENCES `addressreceive` (`AddressReceiveId`),
  CONSTRAINT `Fk_Order_Shipment` FOREIGN KEY (`ShipmentId`) REFERENCES `shipment` (`ShipmentId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
