INSERT INTO `product` VALUES ('05bf2688-b6c9-4781-b0ae-dc4e35b91101','JNQDA024','Quần Xếp Ly Ống Suông Rộng',1,1009,495000,10,'<p>- Quần xếp ly ống su&ocirc;ng rộng thanh lịch, thời thượng</p>\n<p>- Trang phục ph&ugrave;&nbsp;hợp&nbsp;dạo phố, đi l&agrave;m,...</p>\n<p>- K&iacute;ch thước &aacute;o: S - M - L</p>\n<p>- Chiều d&agrave;i:</p>\n<p>S : 96,5 cm -&nbsp;M : 98&nbsp;cm&nbsp;-&nbsp;L: 99,5&nbsp;cm</p>\n<p><strong>Hướng dẫn sử&nbsp;dụng</strong><br>- Giặt tay bằng nước lạnh</p>\n<p>&nbsp;- Kh&ocirc;ng ng&acirc;m, kh&ocirc;ng tẩy&nbsp;</p>\n<p>- Giặt ri&ecirc;ng c&aacute;c sản phẩm kh&aacute;c m&agrave;u</p>\n<p>- Kh&ocirc;ng vắt</p>\n<p>- L&agrave; ủi ở nhiệt độ thấp.</p>\n<p>- Khuyến k&iacute;ch giặt kh&ocirc;</p>','2023-05-13 10:59:00','2023-05-14 18:00:28','2023-05-14 18:00:28',1,0,'88170183-b857-49d9-aebe-effb15c82e53','e78b8c2c-5f04-45ca-8366-fb6132474a93',0,99),('0a90bce8-c221-41e1-8d97-1e8d8e40f519','I9TSH554I','Áo T-Shirt Nữ Cổ Tròn I9TSH554I',44,1149,85000,30,'<div class=\"panel-title\">\n<h2>TH&Ocirc;NG TIN SẢN PHẨM</h2>\n</div>\n<div class=\"panel-description \">\n<div class=\"description-productdetail typeList-style\">\n<p><strong>ĐẶC ĐIỂM NỔI BẬT</strong><br>- Chất vải co gi&atilde;n, giữ form hiệu quả, thấm h&uacute;t mồ h&ocirc;i<br>- Thiết kế basic, trẻ trung, năng động, thoải m&aacute;i trong mọi hoạt động thường ng&agrave;y.<br>- Độ bền cao, bền m&agrave;u<br>- Đường may tỉ mỉ, kh&ocirc;ng chỉ thừa, độ ho&agrave;n thiện cao<br>- M&agrave;u sắc đa dạng, dễ mix đồ với nhiều loại trang phục kh&aacute;c.&nbsp;</p>\n<p><strong>CHẤT LIỆU:</strong><br>Cotton + Polyester + Spandex</p>\n<p><strong>M&Agrave;U SẮC</strong><br>Trắng/đen/đỏ/t&iacute;m than/ghi...</p>\n<p><strong>KIỂU D&Aacute;NG</strong><br>cổ tr&ograve;n</p>\n<p><strong>HƯỚNG DẪN SỬ DỤNG &amp; BẢO QUẢN:</strong><br>- Lộn tr&aacute;i sản phẩm khi giặt, kh&ocirc;ng giặt chung sản phẩm với quần &aacute;o tối m&agrave;u.<br>- Kh&ocirc;ng sử dụng chất tẩy, kh&ocirc;ng ng&acirc;m sản phẩm.<br