CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_AddressReceive_GetByFilter`(IN p_TextSearch varchar(255), IN p_PageNumber tinyint, IN p_PageSize tinyint,IN p_parentId char(36), OUT TotalRecords int)
BEGIN



  CREATE TEMPORARY TABLE IF NOT EXISTS tblOrginal AS



  SELECT

    ROW_NUMBER() OVER (

    ORDER BY a.CreatedAt DESC) AS RowIndex,

    a.*

  FROM addressreceive a

  WHERE (p_TextSearch IS NULL

  OR a.Receiver LIKE CONCAT('%', p_TextSearch, '%')

  OR a.AddressDetail LIKE CONCAT('%', p_TextSearch, '%'))
  and (a.IsDelete = 0 or a.IsDelete is null)
  and a.CustomerId = p_parentId
  order by a.ModifiedAt DESC;

  SET @indexFirst = p_PageNumber * p_PageSize - p_PageSize + 1;



  SET @indexLast = p_PageNumber * p_PageSize;



  SET TotalRecords = (SELECT

      COUNT(*)

    FROM tblOrginal);



  SELECT

    *

  FROM tblOrginal do

  WHERE do.RowIndex BETWEEN @indexFirst AND @indexLast;



  DROP TEMPORARY TABLE IF EXISTS tblOrginal;




END ;;
DELIMITER ;
