CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Cart_GetByFilter`(
IN p_TextSearch VARCHAR(255), 
IN p_PageNumber TINYINT, 
IN p_PageSize tinyint,
IN p_ParentId char(36)
)
BEGIN



    CREATE TEMPORARY TABLE IF NOT EXISTS tblOrginal AS



    SELECT ROW_NUMBER() OVER (ORDER BY c.ModifiedAt DESC ) AS RowIndex ,

    c.*, p1.ProductName, p1.ProductId, c2.ColorName, s.SizeCode, p1.PriceSale, p1.Discount,p1.IsMassDiscount,p1.MassDiscount,p.Quantity as ProVariantQuantity,i.ImageId,i.ImageLink,i.ImageName
    FROM cart c
    JOIN customer c1 ON c.CustomerId = c1.CustomerId
    JOIN productvariant p ON c.ProductVariantId = p.ProductVariantId
    JOIN product p1 ON p.ProductId = p1.ProductId
    left JOIN color c2 ON p.ColorId = c2.ColorId
    left JOIN size s ON p.SizeId = s.SizeId
    left Join image i on i.ObjectId = p1.ProductId
    WHERE c1.CustomerId = p_ParentId;
        set @indexFirst = p_PageNumber * p_PageSize - p_PageSize +1;
        set @indexLast = p_PageNumber * p_PageSize;





      SELECT * FROM tblOrginal do WHERE do.RowIndex BETWEEN @indexFirst AND @indexLast;



     DROP TEMPORARY TABLE IF EXISTS tblOrginal;





END ;;
