CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Cart_Insert`(p_CartId char(36),

   p_ProductVariantId char(36),

   p_Quantity int,

   p_CreatedAt datetime,

   p_ModifiedAt datetime,

   p_CustomerId char(36)
)
BEGIN

    set @cart = (SELECT c.CartId FROM cart c WHERE c.ProductVariantId = p_ProductVariantId and c.CustomerId = p_CustomerId);
  IF  @cart IS NOT NULL THEN
    UPDATE cart c SET c.Quantity = c.Quantity + p_Quantity WHERE c.CartId = @cart;
   ELSE

  INSERT cart (CartId, Quantity, CreatedAt, ModifiedAt, CustomerId, ProductVariantId)

  VALUES (p_CartId, p_Quantity, p_CreatedAt, p_CreatedAt, p_CustomerId, p_ProductVariantId);

  

  END IF;



END ;;
