CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_OrderDetail_Insert`(p_OrderDetailId char(36),

  p_Quantity int,

  p_CreatedAt datetime ,

  p_PriceSale decimal,

  p_ProductVariantId char(36) ,

  p_OrderId char(36),

  p_Discount int


)
BEGIN

  

  INSERT orderdetail (OrderDetailId, Quantity, PriceSale, CreatedAt, OrderId, ProductVariantId, Discount)

  VALUES (p_OrderDetailId, p_Quantity, p_PriceSale, p_CreatedAt, p_OrderId, p_ProductVariantId, p_Discount);
  
  UPDATE productvariant p SET p.Quantity = p.Quantity - p_Quantity WHERE p.ProductVariantId = p_ProductVariantId;
  set @product = (SELECT p.ProductId FROM productvariant p WHERE p.ProductVariantId = p_ProductVariantId);
  UPDATE product p SET p.Quantity = p.Quantity - p_Quantity, p.Sold = p.Sold + p_Quantity WHERE p.ProductId = @product;
  
  /*Update productvariant pv,product p join pv on pv.ProductId = p.ProductId 
  set pv.Quantity = pv.Quantity - p_Quantity,
  p.Quantity = p.Quantity - p_Quantity ,
  p.Sold = p.Sold + p_Quantity
  where pv.ProductVariantId = p_ProductVariantId;*/

END ;;
