CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Order_GetByFilter`(IN p_TextSearch varchar(255), IN p_PageNumber tinyint, IN p_PageSize tinyint,IN p_Status tinyint,IN p_parentId char(36), OUT TotalRecords int)
BEGIN



  CREATE TEMPORARY TABLE IF NOT EXISTS tblOrginal AS



  SELECT

    ROW_NUMBER() OVER (

    ORDER BY o.ModifiedAt DESC) AS RowIndex,

    o.*,c.FullName,s.ShipmentName

  FROM `order` o 
  join customer c on c.CustomerId = o.CustomerId
  join shipment s on s.ShipmentId = o.ShipmentId
  WHERE (p_TextSearch IS NULL
  OR o.Receiver LIKE CONCAT('%',trim(p_TextSearch), '%')
  Or o.OrderCode LIKE CONCAT('%',trim(p_TextSearch), '%')
  )
  and ( p_Status  = 0
  or o.`Status` = p_Status
  )
  and (p_parentId is null or o.CustomerId = p_parentId);
  SET @indexFirst = p_PageNumber * p_PageSize - p_PageSize + 1;



  SET @indexLast = p_PageNumber * p_PageSize;



  SET TotalRecords = (SELECT

      COUNT(*)

    FROM tblOrginal);



  SELECT

    *

  FROM tblOrginal do

  WHERE do.RowIndex BETWEEN @indexFirst AND @indexLast;



  DROP TEMPORARY TABLE IF EXISTS tblOrginal;





END ;;
