CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Order_UpdateStatus`(p_OrderId char(36), p_Status tinyint,p_CancelReason varchar(255))
BEGIN
    IF p_Status = 6 THEN
		UPDATE `order` o
		JOIN orderdetail od ON o.OrderId = od.OrderId
		JOIN productvariant pv ON pv.ProductVariantId = od.ProductVariantId
		JOIN product p ON p.ProductId = pv.ProductId
		SET o.status = p_Status,
			pv.quantity = pv.quantity + od.Quantity ,
			p.Quantity = p.Quantity + od.Quantity ,
            p.Sold = p.Sold - od.Quantity ,
            o.CancelReason = p_CancelReason
		WHERE o.OrderId = p_OrderId;
   ELSEIF p_Status = 4 or   p_Status = 5 THEN
	Update `order` set `Status` = p_Status , IsPaid = 1   where OrderId = p_OrderId;
   ELSE
	Update `order` set Status = p_Status where OrderId = p_OrderId;
	END IF;
END ;;
DELIMITER ;
