CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_ProductVariant_Insert`(p_ProductVariantId char(36),

  p_Quantity int ,

  p_CreatedAt datetime ,

  p_ProductId char(36) ,

  p_ColorId char(36),

  p_SizeId char(36),

  p_PriceSupply decimal,
  p_SupplierId char(36)

)
BEGIN

  set @productVariant = (SELECT p.ProductVariantId FROM productvariant p WHERE p.ColorId = p_ColorId AND p.SizeId = p_SizeId and p.ProductId = p_ProductId);
  IF  @productVariant IS NOT NULL THEN
    UPDATE productvariant p SET p.Quantity = p.Quantity + p_Quantity WHERE P.ProductVariantId = @productVariant;
    INSERT supply (SupplyId, SupplyDate, Quantity, PriceSupply, SupplierId, ProductVariantId)
  VALUES (uuid(), NOW(), p_Quantity, p_PriceSupply, p_SupplierId, @productVariant);
   ELSE

  INSERT INTO productvariant (ProductVariantId, Quantity, CreatedAt, ModifiedAt, ProductId, ColorId, SizeId)

  VALUES (p_ProductVariantId,p_Quantity, p_CreatedAt,p_CreatedAt,p_ProductId,p_ColorId,p_SizeId);

  

  INSERT supply (SupplyId, SupplyDate, Quantity, PriceSupply, SupplierId, ProductVariantId)

  VALUES (uuid(), NOW(), p_Quantity, p_PriceSupply, p_SupplierId, p_ProductVariantId);



  END IF;

  

  

  update product set quantity = quantity + p_Quantity where ProductId = p_ProductId;



END ;;
