CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_ProductVariant_Update`(IN p_ProductVariantId CHAR(36), 

IN p_Quantity INT, 

IN p_ModifiedAt DATETIME, 

IN p_ProductId CHAR(36), 

IN p_ColorId CHAR(36), 

IN p_SizeId CHAR(36))
BEGIN


	
  update product set quantity = quantity - (select Quantity from ProductVariant where  ProductVariantId = p_ProductVariantId) + p_Quantity where ProductId = p_ProductId;
  

  UPDATE productvariant p 

SET Quantity = p_Quantity,

    ModifiedAt = p_ModifiedAt,

    ProductId = p_ProductId,

    ColorId = p_ColorId,

    SizeId = p_SizeId

WHERE ProductVariantId = p_ProductVariantId;


END ;;
