CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Product_GetByFilter`(IN p_TextSearch VARCHAR(255), IN p_PageNumber TINYINT, IN p_PageSize TINYINT, IN p_TypeId char(36) ,IN p_BrandId char(36))
BEGIN



  CREATE TEMPORARY TABLE IF NOT EXISTS tblOrginal AS



  SELECT

    ROW_NUMBER() OVER ( partition by p.ProductId order by p.CreatedAt) AS RowIndex,

    p.*,t.TypeName,b.BrandName,i.ImageId,i.ImageLink,i.ImageName

  FROM product p 
  JOIN brand b ON p.BrandId = b.BrandId 
  JOIN type t ON p.TypeId = t.TypeId
  left join image i on i.ObjectId = p.ProductId

  WHERE (p_TextSearch IS NULL

  OR p.ProductCode LIKE CONCAT('%', p_TextSearch, '%')

  OR p.ProductName LIKE CONCAT('%', p_TextSearch, '%'))
  and (p.IsDelete = 0 or p.IsDelete IS NULL)
  and (p_TypeId is null or p.TypeId = p_TypeId)
	and (p_BrandId is null or p.BrandId= p_BrandId)
		  and (p.IsDelete = 0 or p.IsDelete IS NULL);

  SET @indexFirst = p_PageNumber * p_PageSize - p_PageSize + 1;



  SET @indexLast = p_PageNumber * p_PageSize;

  SELECT

    *

  FROM tblOrginal do

  WHERE do.RowIndex BETWEEN @indexFirst AND @indexLast;



  DROP TEMPORARY TABLE IF EXISTS tblOrginal;



END ;;
DELIMITER ;
