CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Statistic_Default`(p_FromDate datetime,p_ToDate datetime)
BEGIN
	select 
    sum(`order`.TotalPrice) as 'Revenue', 
    count(`order`.OrderId) as 'OrderNumber' ,
    (
		 select count(product.ProductId) from product where (IsDelete is null or IsDelete = 0)
    ) as 'ProductNumber',
    (
		select count(customer.CustomerId)  from customer where (IsDelete is null or IsDelete = 0)
    ) as 'CustomerNumber' 
    from `order` where IsPaid = 1;
END ;;
