CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Statistic_SellingProductToMonthNow`(p_Year int,p_Month tinyint)
BEGIN
	select p.ProductName,sum(od.Quantity) as TotalQuantity
    from `order` o 
    join orderdetail od on od.OrderId = o.OrderId
    join productvariant pv on pv.ProductVariantId = od.ProductVariantId
    join product p on pv.ProductId = p.ProductId
    where month(o.CreatedAt) = p_Month and YEAR(o.CreatedAt) = p_Year
    and IsPaid = 1
    group by p.ProductId 
    order by TotalQuantity DESC
    limit 0,5;
END ;;
DELIMITER ;
