CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Statistic_StatisticRevenue`(p_Year int)
BEGIN
	select month(o.CreatedAt) as `Month`,sum(o.TotalPrice) as TotalPrice
    from  `order` o 
    where YEAR(o.CreatedAt) = p_Year
    and IsPaid = 1 and o.`Status` != 6
    group by `Month`;
END ;;
