CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Supply_GetByFilter`(IN p_TextSearch varchar(255), IN p_PageNumber tinyint, IN p_PageSize tinyint, OUT TotalRecords int)
BEGIN



  CREATE TEMPORARY TABLE IF NOT EXISTS tblOrginal AS



  SELECT

    ROW_NUMBER() OVER (

    ORDER BY s.SupplyDate DESC) AS RowIndex,

    s.*, p1.ProductCode, p1.ProductName, s2.SizeCode, c.ColorName,s1.SupplierName

  FROM supply s
  JOIN productvariant p ON s.ProductVariantId = p.ProductVariantId
  JOIN supplier s1 ON s.SupplierId = s1.SupplierId
  JOIN product p1 ON p.ProductId = p1.ProductId
  JOIN size s2 ON p.SizeId = s2.SizeId
  JOIN color c ON p.ColorId = c.ColorId
  WHERE (p_TextSearch IS NULL

  OR s.SupplyDate LIKE CONCAT('%', p_TextSearch, '%'));
  SET @indexFirst = p_PageNumber * p_PageSize - p_PageSize + 1;



  SET @indexLast = p_PageNumber * p_PageSize;



  SET TotalRecords = (SELECT

      COUNT(*)

    FROM tblOrginal);



  SELECT

    *

  FROM tblOrginal do

  WHERE do.RowIndex BETWEEN @indexFirst AND @indexLast;



  DROP TEMPORARY TABLE IF EXISTS tblOrginal;




END ;;
