CREATE DEFINER=`root`@`localhost` PROCEDURE `Proc_Type_GetByFilter`(IN p_TextSearch varchar(255), IN p_PageNumber tinyint, IN p_PageSize tinyint, OUT TotalRecords int)
BEGIN



  CREATE TEMPORARY TABLE IF NOT EXISTS tblOrginal AS



  SELECT

    ROW_NUMBER() OVER (

    ORDER BY t.ModifiedAt DESC) AS RowIndex,

    t.*

  FROM type t

  WHERE (p_TextSearch IS NULL

  OR t.TypeCode LIKE CONCAT('%', p_TextSearch, '%')

  OR t.TypeName LIKE CONCAT('%', p_TextSearch, '%'))
  and (t.IsDelete = 0 or t.IsDelete is null);

  SET @indexFirst = p_PageNumber * p_PageSize - p_PageSize + 1;



  SET @indexLast = p_PageNumber * p_PageSize;



  SET TotalRecords = (SELECT

      COUNT(*)

    FROM tblOrginal);



  SELECT

    *

  FROM tblOrginal do

  WHERE do.RowIndex BETWEEN @indexFirst AND @indexLast;



  DROP TEMPORARY TABLE IF EXISTS tblOrginal;




END ;;
